    from base64 import b64encode
    TAG_NUMS_DECODED.update({
    })
    TAG_NUMS_DECODED = {
        k: v for k, v in sorted(sorted(TAG_NUMS_DECODED.items(), key=lambda item: item[0]), key=lambda item: item[1])
    }  # type: Dict[str, str]
    re_dict_keys_replace = re_compile(r'([^"]*)"([^\']+)\'([^"]+)"')
    TAG_NUMS_ENCODED = (
        b64encode(re_dict_keys_replace.sub("\\1'\\2;\\3'", str(TAG_NUMS_DECODED)).replace("'", '"').replace(';', "'").encode()).decode()
    )
    result = b64decode(TAG_NUMS_ENCODED)
    TAG_NUMS_DECODED = {k.replace(' ', '_'): (v[:v.find(',')] if ',' in v else v) for k, v in loads(result).items()}
    Log.trace(TAG_NUMS_ENCODED)
    Log.trace(result.decode())
